import React, { ReactNode } from "react";

import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";

// Pages
import App from "./App";

const component: ReactNode = (
  <div>
    <h1>Hello World</h1>
    <Link to="about">About Us</Link>
  </div>
);

const router = createBrowserRouter([
  {
    path: "/",
    element: component,
  },
  {
    path: "/feed",
    element: component,
  },
  {
    path: "/calendar",
    element: component,
  },
  {
    path: "/about",
    element: <App />,
  },
]);

export default router;
